pragma solidity >=0.4.21 <0.7.0;

import "/Users/shaunhillin/Documents/WebstormProjects/final_project/node_modules/@openzeppelin/contracts/token/ERC721/ERC721Full.sol";
import "/Users/shaunhillin/Documents/WebstormProjects/final_project/node_modules/@openzeppelin/contracts/token/ERC721/ERC721Metadata.sol";


contract CountyClerkRepository is ERC721Full {

    struct DeedInfo{
        string name;
        string street;
    }

    // mapping from deedid to DeedInfo
    mapping (uint256 => DeedInfo) private deeds;

    constructor() public ERC721Full("County Clerk Title Repository", "CCTP"){
    }
    /**
    * Used to register new deed
    **/
    function registerDeed(uint256 _tokenId, string memory _name, string memory _street) public {
        _mint(msg.sender, _tokenId);
        addDeedData(_tokenId, _name, _street );
        emit DeedRegistered(msg.sender, _tokenId);
    }

    /**
    * @dev Event is triggered if deed/token is registered
    * @param _by address of the registrar
    * @param _tokenId uint256 represents a specific deed
    */

    /**
    *Add Deed meta data
    *
    **/
    function addDeedData(uint256 _tokenId, string memory _name, string memory _street) public {
        deeds[_tokenId]= DeedInfo({
            name: _name,
            street: _street
        });
    }

    //TODO retrieve owner

    /**
    *Triggered if Deed is registered
    *
    **/
    event DeedRegistered(address _by, uint256 _tokenId);
}
